#
# Structure for the `apjgeneromusima` table : 
#

DROP TABLE IF EXISTS `apjgeneromusima`;

CREATE TABLE `apjgeneromusima` (
  `apj_nroreg_apgm` varchar(6) NOT NULL COMMENT 'Código secuencial unico registro maestro',
  `apj_titgen_apgm` varchar(30) DEFAULT NULL COMMENT 'Titulo corto para vista en iconos y opciones del sistema',
  `apj_desgen_apgm` text COMMENT 'Descripcion larga o breve reseña general del genero musical',
  `apj_imgvis_apgm` varchar(30) DEFAULT NULL COMMENT 'Imagen o icono que representa el genero musical',
  `apj_icolor_apgm` varchar(30) DEFAULT NULL COMMENT 'Color del fondo para el genero musical',
  `apj_keypas_apgm` varchar(150) DEFAULT NULL COMMENT 'llave palabra clave genero ejemplo: SALSA-SALSABRAVA/ROCK/CHAMPETA TERAPIACRIOLLA/VALLENATO YUCA',
  `apj_keyloc_apgm` text COMMENT 'llave para busquedas generada según llave palabra clave genero y los instrumentos musicales y roles artisticos dentro del genero',
  `apj_secdea_apgm` int(10) DEFAULT NULL COMMENT 'Campo para generar el secuencial de registros para detalles',
  `apj_estreg_apgm` varchar(1) DEFAULT NULL COMMENT 'Estado del registro: 1= Activo 2= Inactivo',
  PRIMARY KEY (`apj_nroreg_apgm`),
  KEY `apgm02` (`apj_titgen_apgm`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# Structure for the `apjgeneromusimd` table : 
#

DROP TABLE IF EXISTS `apjgeneromusimd`;

CREATE TABLE `apjgeneromusimd` (
  `apj_nroreg_aprg` varchar(10) NOT NULL COMMENT 'Código secuencial unico registro',
  `apj_nroreg_apgm` varchar(6) DEFAULT NULL COMMENT 'Código registro maestro genero musical',
  `apj_nroreg_apro` varchar(10) DEFAULT NULL COMMENT 'Código maestro roles musicales para generos',
  `apj_estreg_aprg` varchar(1) DEFAULT NULL COMMENT 'Estado del registro: 1= Activo 2= Inactivo',
  PRIMARY KEY (`apj_nroreg_aprg`),
  KEY `aprg02` (`apj_nroreg_apgm`),
  KEY `aprg03` (`apj_nroreg_apro`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# Structure for the `apjmaeshomepama` table : 
#

DROP TABLE IF EXISTS `apjmaeshomepama`;

CREATE TABLE `apjmaeshomepama` (
  `apj_nroreg_aphp` varchar(40) NOT NULL COMMENT 'Código secuencial unico homepage grupo musical o artista individual',
  `apj_titgru_aphp` varchar(60) DEFAULT NULL COMMENT 'Titulo del grupo musical o artista individual',
  `apj_lnkgru_aphp` varchar(30) DEFAULT NULL COMMENT 'Link o url unica llegar al home page del artista (sin espacios entre caracteres ) ejemplo: rolando_8',
  `apj_exlema_aphp` text COMMENT 'Descripcion larga o breve reseña del artista o gurpo musical',
  `apj_tipart_aphp` varchar(1) DEFAULT NULL COMMENT 'Tipo HomePage Artista o grupo musical: 1=Artista Individual 2=Grupo musical',
  `rec_nroreg_reus` varchar(40) DEFAULT NULL COMMENT 'Código usuario que crea o administra el homepage artista',
  `sis_codpai_sipa` varchar(4) DEFAULT NULL COMMENT 'Codigo del pais de residencia',
  `sis_codpro_sipr` varchar(14) DEFAULT NULL COMMENT 'Codigo ciudad/Provincia de residencia',
  `sis_idedpt_sidp` varchar(8) DEFAULT NULL COMMENT 'Codigo del departamento o estado (codigo unico pais + codigo departamento)',
  `apj_geoest_aphp` varchar(1) DEFAULT NULL COMMENT 'Revelar ubicación o  geolocalizacion para que sea visible a los usuarios: 1=Visible 2=No visible',
  `apj_geolat_aphp` double(14,10) DEFAULT NULL COMMENT 'Latitud para geolocalizacion',
  `apj_geolon_aphp` double(14,10) DEFAULT NULL COMMENT 'Longitud para geolocalizacion',
  `apj_valtra_aphp` double(3,1) DEFAULT NULL COMMENT 'Calificacion según trayectoria musical, numero de estrellas, rango de 1 a 5',
  `apj_valcal_aphp` double(3,1) DEFAULT NULL COMMENT 'Calificacion según calidad interprestativa, numero de estrellas, rango de 1 a 5',
  `apj_valpun_aphp` double(3,1) DEFAULT NULL COMMENT 'Calificacion según puntualidad rango de 1 a 5',
  `apj_valpop_aphp` double(3,1) DEFAULT NULL COMMENT 'Calificacion popularidad rango de 1 a 5 según numero de usuarios que lo tienen en lista de favoritos',
  `apj_totseg_aphp` int(10) DEFAULT NULL COMMENT 'Cantidad total de seguidores, personas que marcaron como favorito al artista o grupo musical',
  `apj_estaut_aphp` varchar(1) DEFAULT NULL COMMENT 'Estado autenticacion (verificada) de la cuenta: 1= Autenticada 2= No autenticada  (palabra key : auten)',
  `apj_estges_aphp` varchar(1) DEFAULT NULL COMMENT 'Estado del artista para contratacion: 1= Activo para contratar 2= No activo para contratar  (palabra key : cont)',
  `apj_estdis_aphp` varchar(1) DEFAULT NULL COMMENT 'Estado del artista que esta activo para contratacion según APJ_ESTGES_APHP: 1=Con Agenda y disponible 2=Con agenda pero ya esta ocupado 3=Sin agenda (no disponible)  (palabra key : agen)',
  `apj_estloc_aphp` varchar(1) DEFAULT NULL COMMENT 'Estado del artista en busquedas: 1= Visible en busqueda 2= No visible para busquedas  (palabra key : buscar)',
  `apj_estpen_aphp` varchar(1) DEFAULT NULL COMMENT 'Estado Penalizado: 1= No Penalizado 2= Penalizado 3=Suspendido (palabra key : penalizado)',
  `apj_peifec_aphp` date DEFAULT NULL COMMENT 'Fecha en que inicia la penalizacion o suspensión',
  `apj_peihor_aphp` decimal(5,2) DEFAULT NULL COMMENT 'Hora formato militar en que inicia penalizacion',
  `apj_peikey_aphp` int(15) DEFAULT NULL COMMENT 'llave inicio penalizacion, para facilitar busquedas de rango penalizacion (para utilidad del sistema)',
  `apj_peffec_aphp` date DEFAULT NULL COMMENT 'Fecha en que finaliza la penalizacion o suspensión',
  `apj_pefhor_aphp` decimal(5,2) DEFAULT NULL COMMENT 'Hora formato militar en que finaliza penalizacion o suspensión',
  `apj_pefkey_aphp` int(15) DEFAULT NULL COMMENT 'llave fin penalizacion, para facilitar busquedas de rango penalizacion (para utilidad del sistema)',
  `apj_legalr_aphp` int(6) DEFAULT NULL COMMENT 'Contador de reportes o click del boton denunciar, para publicaciones o perfiles que infringen normas de usuarios',
  `apj_keyest_aphp` varchar(80) DEFAULT NULL COMMENT 'Lista de: PALABRAS-ESTADOS /AGENDA/ UBICACION/POPULARIDAD/PUNTUALIDAD/PENALIZ  y otros',
  `apj_keyloc_aphp` varchar(180) DEFAULT NULL COMMENT 'Lista de palabras claves para que los usuarios puedan encontrar el registro desde busqueda',
  `apj_keyage_aphp` varchar(240) DEFAULT NULL COMMENT 'Lista de palabras claves de la programacion agenda disponible',
  `apj_keyrai_aphp` int(12) DEFAULT NULL COMMENT 'Llave (año+mes+dia+hora+minutos) inicia la progrmacion de agenda ',
  `apj_keyraf_aphp` int(12) DEFAULT NULL COMMENT 'Llave(año+mes+dia+hora+minutos)finaliza la progrmacion de agenda',
  `sis_counta_rkey` int(10) DEFAULT NULL COMMENT 'Campo para generar el secuencial de registros para detalles A',
  `sis_countb_rkey` int(10) DEFAULT NULL COMMENT 'Campo para generar el secuencial de registros para detalles B',
  `sis_countc_rkey` int(10) DEFAULT NULL COMMENT 'Campo para generar el secuencial de registros para detalles C',
  `sis_countd_rkey` int(10) DEFAULT NULL COMMENT 'Campo para generar el secuencial de registros para detalles',
  `sis_counte_rkey` int(10) DEFAULT NULL COMMENT 'Campo para generar el secuencial de registros para detalles',
  `apj_estreg_aphp` varchar(1) DEFAULT NULL COMMENT 'Estado del registro: 1= Activo 2= Inactivo 3=Eliminado',
  `llave` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`apj_nroreg_aphp`),
  KEY `aphp02` (`apj_titgru_aphp`),
  KEY `aphp03` (`apj_lnkgru_aphp`),
  KEY `aphp04` (`rec_nroreg_reus`),
  KEY `aphp05` (`sis_codpai_sipa`),
  KEY `aphp06` (`sis_codpro_sipr`),
  KEY `aphp07` (`apj_peikey_aphp`),
  KEY `aphp08` (`apj_pefkey_aphp`),
  KEY `aphp09` (`sis_codpai_sipa`),
  KEY `aphp10` (`sis_codpro_sipr`),
  KEY `aphp11` (`apj_keyrai_aphp`),
  KEY `aphp12` (`apj_keyraf_aphp`),
  KEY `aphp13` (`sis_idedpt_sidp`),
  FULLTEXT KEY `keylocate` (`apj_keyest_aphp`,`apj_keyloc_aphp`,`apj_keyage_aphp`),
  FULLTEXT KEY `key1` (`apj_keyest_aphp`),
  FULLTEXT KEY `key2` (`apj_keyloc_aphp`),
  FULLTEXT KEY `key3` (`apj_keyage_aphp`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

