  `apj_nroreg_aphp` varchar(40) DEFAULT NULL COMMENT 'Código del registro de artista o grupo musical al cual pertenece el recurso',
  `rec_observ_regl` varchar(120) DEFAULT NULL COMMENT 'Titulo del recurso o nota texto para cuando sea requerido (diligeciada por el usuario)',
  `rec_grprec_regr` varchar(4) DEFAULT NULL COMMENT 'Grupo al que pertenece el archivo de recurso  (grupos según se usan para vistas de configuracion en la aplicación) ejemplo:  H01=Imagen icono del perfil Home Artista H02= Imagen banner perfil HomeArtista, H03=Imagen carrusel',
  `rec_tiprec_regl` varchar(1) DEFAULT NULL COMMENT 'Tipo recurso 1=Imagen Servior Local 2=Link Video Youtube 3=Link video Facebook 4=Link video Instagram 5=Link Foto Facebook 6=Link foto Instagram 7=Imagen Servidor FireBaseStore',
  `rec_nomrec_regl` text COMMENT 'Nombre fisico del recurso dentro de las rutas del sistema',
  `rec_ordvis_regl` int(3) DEFAULT NULL COMMENT 'Orden visualizacion de los recursos dentro de vistas tales como el carrusel',
  `rec_recax1_regl` varchar(90) DEFAULT NULL COMMENT 'Nombre fisico del recurso auxiliar 1 en caso que sea necesario',
  `rec_recax2_regl` varchar(90) DEFAULT NULL COMMENT 'Nombre fisico del recurso auxiliar 2 en caso que sea necesario',
  `rec_recax3_regl` varchar(90) DEFAULT NULL COMMENT 'Nombre fisico del recurso auxiliar 3 en caso que sea necesario',
  `rec_fecrec_regl` date DEFAULT NULL COMMENT 'Fecha en la cual se cargo el archivo de recurso',
  `rec_horrec_regl` decimal(5,2) DEFAULT NULL COMMENT 'Hora formato militar en la cual se carga el recurso',
  `rec_rllave_regl` int(15) DEFAULT NULL COMMENT 'llave que concatena la fecha y hora del recurso, para descartar los antiguos y limitar vista solo a recursos mas actualizados',
  `rec_estreg_regl` varchar(1) DEFAULT NULL COMMENT 'Estado del registro: 1= Activo 2= Inactivo',
  `llave` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`rec_nroreg_regl`),
  KEY `regl02` (`apj_nroreg_aphp`),
  KEY `regl03` (`rec_grprec_regr`),
  KEY `regl04` (`rec_rllave_regl`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

