#
# Structure for the `sysgeneratekey` table : 
#

DROP TABLE IF EXISTS `sysgeneratekey`;

CREATE TABLE `sysgeneratekey` (
  `sys_identifkey_gkey` varchar(30) NOT NULL COMMENT 'Llave única para localizar el Secuencial',
  `sys_identifkey_modu` varchar(5) DEFAULT NULL COMMENT 'Código del Modulo al cual pertenece el secuencial esto para mostrarlos como grupos',
  `sys_descriptio_gkey` varchar(90) DEFAULT NULL COMMENT 'Descripción del Secuencial',
  `sys_genkeycoun_gkey` int(15) DEFAULT NULL COMMENT 'Ultimo secuencial generado',
  `sys_counterini_gkey` int(15) DEFAULT NULL COMMENT 'Numero desde el cual inicia el conteo',
  `sys_counterend_gkey` int(15) DEFAULT NULL COMMENT 'Numero en el cual Finaliza el conteo',
  `sys_sizemaximu_gkey` int(2) DEFAULT NULL COMMENT 'Indica el tamaño máximo en caracteres para el secuencial generado',
  `sys_alarmtemit_gkey` int(5) DEFAULT NULL COMMENT 'Indica cuantos números secuenciales antes se emite mensaje de alarma de que se cumpla el limite',
  `sys_fillerleft_gkey` varchar(1) DEFAULT NULL COMMENT 'Indica si se rellena el nuevo secuencial con ceros a la izquierda 1 =Si 2=No',
  `sys_textprefix_gkey` varchar(4) DEFAULT NULL COMMENT 'Texto o Identificador Inicial del nuevo código generado',
  `sys_textsuffix_gkey` varchar(4) DEFAULT NULL COMMENT 'Texto o Identificador final del nuevo código generado',
  `sys_statusregi_gkey` varchar(1) DEFAULT NULL COMMENT 'Estado del registro 1=Activo 2=Inactivo',
  PRIMARY KEY (`sys_identifkey_gkey`),
  KEY `gkey02` (`sys_identifkey_modu`),
  KEY `gkey03` (`sys_descriptio_gkey`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

