  (15,'RE0014S00050000003','10572001008','T001','PRESENTACION 5000','información descrita en la CLÁUSULA PRIMERA que se maneje en virtud de este ACUE','Toda la información suministrada por la Parte Reveladora a la Parte Receptora en virtud de lo establecido en este ACUERDO será reconocida por la Parte Receptora como de propiedad de la Parte Reveladora y la divulgación que la Parte Revelado','NA','NA','NA',1,'COP',1,5000,78250,'1'),
  (16,'RE0014S00050000004','10572001008','T001','MAS BASICA 1000','La Parte Receptora no permitirá el acceso a la información de ningún tipo, ni ta','La Parte Receptora no permitirá el acceso a la información de ningún tipo, ni tampoco la divulgará por si misma o por interpuesta persona, de manera parcial o total, sin el previo consentimiento escrito de la Parte Reveladora inclusive para los fines exclusivos de este ACUERDO. La información confidencial o no; no podrá divulgarse por ningún medio sea, entre otros la forma escrita, publicación electrónica, virtual, informes, conferencias, videos, grabaciones etc.  Abstenerse en lo sucesivo de entregar o realizar para sí o para terceros, copias, arreglos, reproducciones, adaptaciones o cualquier otra clase de mutilación, deformación o modificación de la Información.PARÁGRAFO:Toda información que se intercambie entre GLOBAL ESPECIALISTAS SAS O DE CUALQUIER ASOCIADO, CLIENTE O RELACIONADO DE CUALQUIER FORMA firmantes de este ACUERDO deberá hacerse por medio de un canal seguro. Los controles a implementar para este canal se definirán de mutuo acuerdo entre las dos partes','NA','NA','NA',1,'COP',1,5000,58222,'1'),
  (17,'RE0014S00050000006','10157781214290900','T001','TARIFA PREMIUM 8255','Que compete al Ministerio de Salud establecer los datos básicos que deben genera','Que compete al Ministerio de Salud establecer los datos básicos que deben generar los Prestadores de Servicios de Salud, sobre los serv','NA','NA','NA',1,'COP',1,5000,50000,'1'),
  (20,'RE0014S00050000010','10572001006','T001','CONCIERTO NOCHCE','Validación: Consiste en la verificación de los datos registrados, en términos de','Validación: Consiste en la verificación de los datos registrados, en términos de la correspondencia con la definición, estructura y características definidas en esta Resolución¡ la correspondencia con los valores y la referencia cruzada entre variables','NA','NA','NA',5,'COP',1,5000,955000,'1'),
  (21,'RE0014S00050000011','10572001006','T001','EVENTOS LIBRE 89933','Organización: Consiste en el ordenamiento de los datos sobre los  servicios  ind','Organización: Consiste en el ordenamiento de los datos sobre los  servicios  individuales de salud que genera la institución de acuerdo con las estructuras estandarizadas que maneja el Sistema Integral de Información en Salud y que se establecen en esta resolución','NA','NA','NA',6,'COP',1,5000,50000,'1'),
  (22,'RE0014S00050000012','10572001006','T001','EVENTO BASE 58000','Transferencia de datos: Consiste en el envío de los datos, utilizando un medio','Transferencia de datos: Consiste en el envío de los datos, utilizando un medio de comunicación magnético o electrónico, que permita la actualización de los mismos entre las diferentes entidades','NA','NA','NA',7,'COP',1,5000,258777,'1'),
  (23,'RE0014S00050000013','10572001005','T001','EN VIVO 25533','Disposición de información: Consiste en la oferta de información de dominio','Disposición de información: Consiste en la oferta de información de dominio público en medios masivos de comunicación','NA','NA','NA',8,'COP',1,5000,36999,'1'),
  (24,'RE0014S00050000014','10572001005','T001','EN VIVO BASE 787878','Las disposiciones contenidas  en  la presente Resolución son de obligatorio','Las disposiciones contenidas  en  la presente Resolución son de obligatorio cumplimiento por parte de las instituciones prestadoras de servicios de salud (IPS), de los profesionales independientes, o de los grupos de práctica profesional, las entidades administradoras de planes de beneficios','NA','NA','NA',9,'COP',1,5000,200000,'1'),
  (25,'RE0014S00050000015','10572001005','T001','TARIFA 4545454','De acuerdo con lo dispuesto en los artículos 617 y 618 del Estatuto Tributario','De acuerdo con lo dispuesto en los artículos 617 y 618 del Estatuto Tributario, en concordancia con el artículo 618-3 del mismo ordenamiento, en relación con los requisitos que deben cumplir las facturas, se establecen los siguientes datos que se deben registrar en la descripción específica de','NA','NA','NA',10,'COP',1,5000,870000,'1'),
