  (27,'RE0014S00050000017','10572001005','T001','PRECIOS MINIMO 88555','características se ha unificado y estandarizado para todas las entidades a que h','características se ha unificado y estandarizado para todas las entidades a que hace referencia el artículo segundo de la presente Resolución. Los datos de este registro se refieren a la identificación','NA','NA','NA',12,'COP',1,5000,2444400,'1'),
  (28,'RE0014S00050000018','10572001005','T001','MINIMO VENTA','específica, en razón de un plan de aseguramiento o por disposición del SGSSS','específica, en razón de un plan de aseguramiento o por disposición del SGSSS, tales como: las Entidades Promotoras de Salud -EPS- y las que se les asimilen, para el Plan Obligatorio de Salud del Régimen Contributivo¡ las Administradoras del Régimen Subsidiado','NA','NA','NA',13,'COP',1,5000,900000,'1'),
  (29,'RE0014S00050000019','10572001005','T001','MAYORITARIA 545454','establecer los datos básicos que deben generar los Prestadores de Servicios de S','establecer los datos básicos que deben generar los Prestadores de Servicios de Salud, sobre los servicios individuales de salud prestados y facturados a las Entidades Administradoras de Planes de Beneficios, la definición, estructura, flujo y almacenamiento de los mismos, la administración y disposición','NA','NA','NA',14,'COP',1,5000,850000,'1'),
